#!/data/data/com.termux/files/usr/bin/sh
##
##  TermuxVM Installer
##

PACKAGE_NAME="termux-vm"

DEBFILE_SHA256="@__DEBFILE_SHA256__@"
BOOTSTRAP_SHA256="ab0ded395f3e8431da1c3ea1da5d283e02b2b8601602e1fa0b7d79b78a122c71"

## Running under termux-exec is not supported, so unsetting LD_PRELOAD
unset LD_PRELOAD

export BASEDIR="/data/data/com.termux/files"
export PREFIX="${BASEDIR}/usr"
export TMPDIR=$(mktemp -d -p "${BASEDIR}")
if [ ! -d "${TMPDIR}" ]; then
    echo "[!] Failed to create a temporary directory."
    exit 1
fi

export PATH="${TMPDIR}/bin:${PREFIX}/bin:${PREFIX}/bin/applets"
export LD_LIBRARY_PATH="${TMPDIR}/lib:${PREFIX}/lib"

cleanup()
{
    rm -rf "${TMPDIR}" > /dev/null 2>&1
}
trap cleanup EXIT HUP INT QUIT TERM

echo
echo "Termux VM - a QEMU powered environment for Termux"
echo
echo "AUTHOR IS NOT RESPONSIBLE ABOUT ANY DAMAGE OR DATA"
echo "LOSS THAT COULD BE CAUSED BY THIS SOFTWARE"
echo

echo -n "[*] Checking if '${PACKAGE_NAME}' already installed... "
if [ -f "${PREFIX}/etc/os-release" ]; then
    if grep -qi "${PACKAGE_NAME}" "${PREFIX}/etc/os-release"; then
        echo "yes"
        BOOTSTRAP_NEEDED=false
    else
        echo "no"
        BOOTSTRAP_NEEDED=true
    fi
else
    echo "no"
    BOOTSTRAP_NEEDED=true
fi

## Pre-installation steps for bootstrapping
if ${BOOTSTRAP_NEEDED}; then
    ## Unpack files that needed for bootstrapping
    echo -n "[*] Unpacking bootstrap archive... "
    (set -e
        awk '/^__BOOTSTRAP_PAYLOAD_END__/{f=0} f; /^__BOOTSTRAP_PAYLOAD_BEGIN__/{f=1}' "${0}" > "${TMPDIR}/bootstrap.b64"
        base64 -d "${TMPDIR}/bootstrap.b64" > "${TMPDIR}/bootstrap.tar.gz"
        rm -f "${TMPDIR}/bootstrap.b64"
    exit 0) > /dev/null 2>&1
    if [ "${?}" = "0" ]; then
        echo "ok"
    else
        echo "fail"
        exit 1
    fi

    echo -n "[*] Checking SHA-256 of bootstrap archive... "
    if [ $(sha256sum "${TMPDIR}/bootstrap.tar.gz" 2>/dev/null | awk '{ print $1 }' 2>/dev/null) = "${BOOTSTRAP_SHA256}" ]; then
        echo "ok"
    else
        echo "fail"
        exit 1
    fi

    echo -n "[*] Extracting bootstrap archive... "
    if tar zxf "${TMPDIR}/bootstrap.tar.gz" -C "${TMPDIR}" >/dev/null 2>&1; then
        echo "ok"
    else
        echo "fail"
        exit 1
    fi

    ## Removing $PREFIX
    echo -n "[@] Do you want to save your previous prefix ? (y/n): "
    read -r CHOICE
    if [ "${CHOICE}" = "Y" ] || [ "${CHOICE}" = "y" ]; then
        echo -n "[*] Saving '\${PREFIX}' to '~/termux-usr.bak'... "
        (set -e
            if [ -e "${HOME}/termux-usr.bak" ]; then
                rm -rf "${HOME}/termux-usr.bak"
            fi
            mv "${PREFIX}" "${HOME}/termux-usr.bak"
        exit 0) > /dev/null 2>&1
        if [ "${?}" = "0" ]; then
            echo "ok"
        else
            echo "fail"
            exit 1
        fi
    else
        echo -n "[*] Removing prefix... "
        if rm -rf "${PREFIX}" > /dev/null 2>&1; then
            echo "ok"
        else
            echo "fail"
            exit 1
        fi
    fi

    ## Reset path cache after removing $PREFIX
    hash -r

    ## Bootstrapping dpkg
    echo -n "[*] Bootstrapping... "
    (set -e
        mkdir -p "${PREFIX}/var/lib/dpkg"
        mkdir -p "${PREFIX}/var/lib/dpkg/info"
        mkdir -p "${PREFIX}/var/lib/dpkg/updates"
        touch "${PREFIX}/var/lib/dpkg/status"
        tar xf "${TMPDIR}/dpkg.tar" -C "${PREFIX}"
    ) > /dev/null 2>&1
    if [ "${?}" = "0" ]; then
        echo "ok"
    else
        echo "fail"
        exit 1
    fi
fi

if [ "$(dpkg -l | grep '${PACKAGE_NAME}' | awk '{ print $3 }' | cut -d. -f1)" = "1" ]; then
    echo "[!] Incompatible version of Termux VM is installed."
    echo
    echo "    If you install version 2.x over 1.x, current QEMU"
    echo "    disk will be removed due to incompatibility with"
    echo "    the backing image."
    echo
    echo "    Login configuration file (/etc/login_overrides.sh)"
    echo "    will be replaced with an original version, so if you"
    echo "    made changes in it, they will be lost."
    echo
    echo -n "    Do you want to proceed ? (y/n): "
    read -r CHOICE
    echo
    if [ "${CHOICE}" = "Y" ] || [ "${CHOICE}" = "y" ]; then
        killall -9 qemu-system-x86_64 > /dev/null 2>&1

        if ! rm -f "${PREFIX}/etc/login_overrides.sh" > /dev/null 2>&1; then
            echo "[!] Failed to remove '\${PREFIX}/etc/login_overrides.sh'."
            echo "    Remove this file manually and launch installation again."
            exit 1
        fi

        if ! rm -f "${PREFIX}/var/lib/qemu/archlinux.snap.qcow2" > /dev/null 2>&1; then
            echo "[!] Failed to remove '\${PREFIX}/var/lib/qemu/archlinux.snap.qcow2'."
            echo "    Remove this file manually and launch installation again."
            exit 1
        fi
    else
        echo "[!] Installation aborted."
        exit 1
    fi
fi

## Installing package
echo -n "[*] Unpacking '${PACKAGE_NAME}.deb'... "
(set -e
    tail -n+$(awk '/^__DEBFILE_PAYLOAD__/ { print NR + 1; exit 0; }' "${0}") "${0}" > "${TMPDIR}/${PACKAGE_NAME}.deb"
exit 0) > /dev/null 2>&1
if [ "${?}" = "0" ]; then
    echo "ok"
else
    echo "fail"
    exit 1
fi

echo -n "[*] Checking SHA-256 of '${PACKAGE_NAME}.deb'... "
if [ $(sha256sum "${TMPDIR}/${PACKAGE_NAME}.deb" | awk '{ print $1 }') = "${DEBFILE_SHA256}" ]; then
    echo "ok"
else
    echo "fail"
    exit 1
fi

echo "[*] Installing package '${PACKAGE_NAME}':"
echo
if ! dpkg --install --force-confmiss "${TMPDIR}/${PACKAGE_NAME}.deb"; then
    echo
    echo "[*] Failed to install package."
    exit 1
else
    echo
fi

## Now binaries from $PREFIX will be used
export PATH="${PREFIX}/bin"
export LD_LIBRARY_PATH="${PREFIX}/lib"
hash -r

## Post-installation steps for bootstrapping
if ${BOOTSTRAP_NEEDED}; then
    ## Generate host keys for SSH
    echo -n "[*] Generating SSH host key... "
    (set -e
        ssh-keygen -N '' -t ed25519 -f "${PREFIX}/etc/ssh/keys/host_ed25519"
    exit 0) > /dev/null 2>&1
    if [ "${?}" = "0" ]; then
        echo "ok"
    else
        echo "fail"
    fi
fi

echo "[*] Done. Now you have to restart Termux session."
exit 0

